package com.company;import java.util.Scanner;public class TopIntegers_05 {    public static void main(String[] args) {        Scanner scanner = new Scanner(System.in);        String[] input = scanner.nextLine().split(" ");        int[] numbers = new int[input.length];        for (int i = 0; i < numbers.length; i++) {            numbers[i] = Integer.parseInt(input[i]);        }        int temporaryNumber = 0;        for (int i = 0; i < numbers.length; i++) {            temporaryNumber = numbers[numbers.length - 1];            if (numbers[i] > temporaryNumber) {                System.out.print(numbers[i] + " ");            }        }        System.out.print(temporaryNumber);    }}